window.bookSummaryJSON = "<p><b><i>Persona Non Grata</i></b> is Quint Adler's most tumultuous case yet. A close friend of Quint's is murdered and he agrees to investigate it, not knowing just how depraved the case will become. After discovering a second—and then third—murder, Quint knows he should bow out, but he's too far entrenched to turn back now. It may prove fatal for our beloved Quint.</p>"; 
